            <p>Описание того, что предлагает ваша школа.</p>

            <nav className="bottom-navigation">
                <ul>
                    <li><a href="/speaking-clubs">Speaking Clubs</a></li>
                    <li><a href="/super-travel-events">Super Travel Events</a></li>
                    <li><a href="/native-meeting">Native Meeting</a></li>
                    {/* Другие события */}
                </ul>
            </nav>
        </div>
    );
};

export default SchoolInfoBox;
